import React, { useState, useEffect } from 'react';
import {fetchMembers} from './github_api'


export default function Members(){
    const [members, setMembers] = useState([])
    const [isMemberShow, setIsMemberShown] = useState(false);
    useEffect(() => {
        fetchMembers().then(
        (m) => {
          setMembers(m);
        })

    }, []);
    return(
        <>
        <ul className = "list-group mt-5 row">
            {members.map((member) => {
                return(
                <li key = {member.url} className="list-group-item">
                    <div className = "row">
                        <div className = "col-3"></div>
                        <div className="col-4" >
                            <img src={member.avatar_url} alt={member.avatar_url} id="thumbnail"></img>
                        </div>
                        <div className="col-4 mt-3">
                            <button className="btn btn-outline-danger text-dark" value={member.url}>{member.login}</button>
                        </div>
                    </div> 
              </li>);
            })}
        </ul>
        </>
    );
}
